import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';
import Company from './features/company/Company';
import Search from './features/search/Search';
import Property from './features/property/Property';
import Intern from './features/intern/Intern';
import { Helmet } from 'react-helmet';


function App() {
  return (
    <div className="App">
      <Router>
        <Helmet>
          <link rel="canonical" href='https://www.google.com/imgres?imgurl=https%3A%2F%2Futfinsociety.com%2F_nuxt%2Fimg%2F413a210.jpg&imgrefurl=https%3A%2F%2Futfinsociety.com%2Fabout%2F&tbnid=pgRuSoNvkbrbmM&vet=12ahUKEwjUxPmDmvvvAhWgzYsBHYqZC5QQMygAegQIARBg..i&docid=MAcRAE1EYaQM5M&w=914&h=686&q=%E6%9D%B1%E5%A4%A7%E9%87%91%E8%9E%8D%E7%A0%94%E7%A9%B6%E4%BC%9A&ved=2ahUKEwjUxPmDmvvvAhWgzYsBHYqZC5QQMygAegQIARBg'/>
          <title>UT_Finance</title>
        </Helmet>
        <Route exact path='/' component={Intern}/>
        <Route exact path='/search/*/' component={Search}/>
        <Route exact path='/company/*/' component={Company}/>
        <Route exact path='/property/*/' component={Property}/>
      </Router>
    </div>
  );
}

export default App;
